webpackJsonp([0xcd1cdc71415a],{404:function(A,e){A.exports={data:{site:{siteMetadata:{title:"Mike Herchel",author:"Mike Herchel"}},markdownRemark:{id:"/Users/mherchel/sites/herchel-new/src/blog/2018-01-27-enable-google-home-gsuite-admin/index.md absPath of file >>> MarkdownRemark",html:'<p><em>I’m blogging about this with the hope that someone will find this helpful</em>.</p>\n<p>Google sent me a free Google Home Mini because I purchased a new Pixel 2. While setting it up, I received this error message:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/error-5eed9417cc5599b28e2220a8f89e3d69-fc000.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 73.53535353535354%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Google Error message"\n        title=""\n        src="/static/error-5eed9417cc5599b28e2220a8f89e3d69-893a4.jpg"\n        srcset="/static/error-5eed9417cc5599b28e2220a8f89e3d69-bbf57.jpg 200w,\n/static/error-5eed9417cc5599b28e2220a8f89e3d69-260b8.jpg 400w,\n/static/error-5eed9417cc5599b28e2220a8f89e3d69-893a4.jpg 800w,\n/static/error-5eed9417cc5599b28e2220a8f89e3d69-25965.jpg 1200w,\n/static/error-5eed9417cc5599b28e2220a8f89e3d69-e54c8.jpg 1600w,\n/static/error-5eed9417cc5599b28e2220a8f89e3d69-fc000.jpg 1980w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<blockquote>\n<p><strong>Account not supported</strong></p>\n<p>The functionality of the account you are attempting to sign in with is limited by your administrator, and will not work with the Google Home app. Please sign in with a different account.</p>\n</blockquote>\n<p>So, I called Google technical support, and they told me that Google Home Mini does <em>not</em> support custom domains on G-suite! What??? This absolutely makes no sense, but they confirmed it. </p>\n<p>Luckily, I tweeted it and received a response that it is supported in some sense. </p>\n<blockquote class="twitter-tweet" data-lang="en"><p lang="en" dir="ltr">That&#39;s really weird as mine is on my personal domain. Maybe it&#39;s that mine is a legacy GApps account (I still get 100 users free on it)</p>&mdash; Chris Wiegman (@ChrisWiegman) <a href="https://twitter.com/ChrisWiegman/status/957281303862407168?ref_src=twsrc%5Etfw">January 27, 2018</a></blockquote>\n<p>Doing some additional “Googling” I found <a href="https://support.google.com/googlehome/answer/7571892?co=GENIE.Platform%3DAndroid&#x26;hl=en-GB">this knowledge base article</a>, which led me to the solution below:</p>\n<ol>\n<li>Log into your Google Apps Admin. Note you’ll have to hit the “More” button at the bottom of the menu to see this option.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/1-admin-ece44d57e7309ec8cecc53cbff4f1548-9c92d.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 539px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 138.40445269016698%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="\'\'"\n        title=""\n        src="/static/1-admin-ece44d57e7309ec8cecc53cbff4f1548-9c92d.jpg"\n        srcset="/static/1-admin-ece44d57e7309ec8cecc53cbff4f1548-07d71.jpg 200w,\n/static/1-admin-ece44d57e7309ec8cecc53cbff4f1548-d6b5a.jpg 400w,\n/static/1-admin-ece44d57e7309ec8cecc53cbff4f1548-9c92d.jpg 539w"\n        sizes="(max-width: 539px) 100vw, 539px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </li>\n<li>From the Google Admin, click the top left menu button, and go to Apps, and then Additional Google Services.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/2-admin-console-ee69a313e1bfa88caa72e8263270232d-48a5e.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 665px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75.18796992481202%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="\'\'"\n        title=""\n        src="/static/2-admin-console-ee69a313e1bfa88caa72e8263270232d-48a5e.png"\n        srcset="/static/2-admin-console-ee69a313e1bfa88caa72e8263270232d-96a51.png 200w,\n/static/2-admin-console-ee69a313e1bfa88caa72e8263270232d-5db44.png 400w,\n/static/2-admin-console-ee69a313e1bfa88caa72e8263270232d-48a5e.png 665w"\n        sizes="(max-width: 665px) 100vw, 665px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </li>\n<li>Navigate through the pager at the bottom until you find <em>Web and App Activity</em>\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/3-web-activity-62125ce0d282f3a7d76b1032c8337b68-f9cd1.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 59.248554913294804%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="\'\'"\n        title=""\n        src="/static/3-web-activity-62125ce0d282f3a7d76b1032c8337b68-42603.png"\n        srcset="/static/3-web-activity-62125ce0d282f3a7d76b1032c8337b68-f931c.png 200w,\n/static/3-web-activity-62125ce0d282f3a7d76b1032c8337b68-e8031.png 400w,\n/static/3-web-activity-62125ce0d282f3a7d76b1032c8337b68-42603.png 800w,\n/static/3-web-activity-62125ce0d282f3a7d76b1032c8337b68-f9cd1.png 1038w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </li>\n<li>Hover over the row and click the three little menu dots to bring up a contextual menu.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/4-contextual-menu-8381d20a930b670f9c5c9765e2c88181-878d0.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 62.72617611580217%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="\'\'"\n        title=""\n        src="/static/4-contextual-menu-8381d20a930b670f9c5c9765e2c88181-42603.png"\n        srcset="/static/4-contextual-menu-8381d20a930b670f9c5c9765e2c88181-f931c.png 200w,\n/static/4-contextual-menu-8381d20a930b670f9c5c9765e2c88181-e8031.png 400w,\n/static/4-contextual-menu-8381d20a930b670f9c5c9765e2c88181-42603.png 800w,\n/static/4-contextual-menu-8381d20a930b670f9c5c9765e2c88181-878d0.png 829w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </li>\n<li>Select “Turn ON for everyone”\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/5-turn-on-105b52dc7adbb05017f20319ad7b1fe5-8d452.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 797px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 64.366373902133%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="\'\'"\n        title=""\n        src="/static/5-turn-on-105b52dc7adbb05017f20319ad7b1fe5-8d452.png"\n        srcset="/static/5-turn-on-105b52dc7adbb05017f20319ad7b1fe5-bff2c.png 200w,\n/static/5-turn-on-105b52dc7adbb05017f20319ad7b1fe5-03f11.png 400w,\n/static/5-turn-on-105b52dc7adbb05017f20319ad7b1fe5-8d452.png 797w"\n        sizes="(max-width: 797px) 100vw, 797px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </li>\n</ol>\n<p>The change was immediate for me. Hopefully someone can find this useful!</p>',excerpt:"I’m blogging about this with the hope that someone will find this helpful . Google sent me a free Google Home Mini because I purchased a new…",frontmatter:{title:"How to enable support for Google Home Mini on a custom domain using Gsuite",date:"January 27, 2018",author:null}}},pathContext:{slug:"/2018-01-27-enable-google-home-gsuite-admin/"}}}});
